import { useUserCardStyles } from "../../styles";

function UserCard({ user }) {
  const classes = useUserCardStyles();
  const { username } = user

  return (
    <div className={classes.wrapper}>
      <Link to={`/${user.username}`}>

      </Link>
    </div>
    );
}

export default UserCard;
